useEffect(()=>{
    fetch('https://api.covid19api.com/summary')
    .then(response => response.json())
    .then(data => console.log(data),
    setData(data)

    );

})





return(
    <>
     <div className="wrapper">
     <h1>Countries</h1>
     <ul>
       {data1.map(item => <li>{item.Countries}</li>)}
     </ul>
   </div>
   </>
)



}


export default App;
